import React ,{ Component } from 'react';
import {TopicWrapper,
        TopicItem
} from '../style';

class Topic extends Component {
  render(){
    return (
      <TopicWrapper>
          <TopicItem>
            <img 
            className="topic-pic" 
            alt="a"
            src="https://timgsa.baidu.com/timg?image&amp;quality=80&amp;size=b9999_10000&amp;sec=1589812990033&amp;di=8b28fd3f8bc3ca3c9450b9f07b467abb&amp;imgtype=0&amp;src=http%3A%2F%2Fimage.biaobaiju.com%2Fuploads%2F20190508%2F18%2F1557309685-GiDXShNogd.jpeg" 
            />
            社会热点
          </TopicItem>
      </TopicWrapper>
    )
  }
}

export default Topic;
